        # Pass x and the hidden state through RNN layer
        out, hidden = self.rnn(x, hidden)

        # Pass the last output of the sequence to the fully connected layer
        out = self.fc(out[:, -1, :])  # out[:, -1, :] gets the last time step output
        return out, hidden

